import React from "react";
import classes from "./Navbar.module.css";
import Navbar from "react-bootstrap/Navbar";

const navbar = props => (
  <Navbar className={classes.NavBar}>
    <Navbar.Brand href="/" exact>
      Logo
    </Navbar.Brand>

<button>
    Login</button>  </Navbar>
);

export default navbar;
